import React from 'react'


const Navbar = () => {
  function openNav() {
    document.getElementById("mySidenav");
  }
  
  function closeNav() {
    document.getElementById("mySidenav");
  }
  return (
    <div>
    <div id="mySidenav" className="sidenav">
      <a class="closebtn" onClick={closeNav()}>&times;</a>
      <a href="#">About</a>
      <a href="#">Services</a>
      <a href="#">Clients</a>
      <a href="#">Contact</a>
</div>

<span style={{fontsize:"30px",cursor:"pointer", float:"right"}} onClick={openNav()}>&#9776; open</span>

    </div>
  )
}

export default Navbar;
